- Heritage Advice on planning applications for schemes at a range of scales, including significant strategic large scale institutional, residential   and cultural proposals;
- Provision of   Heritage Advice and support services in the production of Policy documentation;
-  Attendance at meetings alongside LLDC Officers to provide advice and guidance on Heritage, conservation area and significant building matters.

Additional information: The contracting authority considers that this contract may be suitable for economic operators that are small or medium enterprises (SMEs). However, any selection of tenderers will be based solely on the criteria set out for the procurement.  The DEADLINE for the receipt of BID RESPONSES for this Invitation to Tender is Monday 24th October 2016 at 17.00hrs. You must register on the Delta website to respond, if you are already registered you will not need to register again, simply use your existing username and password. Once logged on Suppliers must use the following ACCESS CODE F45FKV23HV to view this tender opportunity.
